export const handleStartQuiz = async (page: string) => {

  let startQuizUrl: string;

  if (process.env.NODE_ENV === 'production') {
    startQuizUrl = 'https://darling-choux-63e4e8.netlify.app/.netlify/functions/express/start-quiz';
  } else {
    startQuizUrl = 'http://localhost:8000/start-quiz';
  }

  try {
    const response = await fetch(`${startQuizUrl}`, {
      headers: {
        "Content-Type": "application/json",
      },
      credentials: "include",
    });
    if (response.ok) {
      window.location.href = page === "home" ? "/quiz" : "/";
    }
  } catch (error) {
    console.error("Error setting session data:", error);
  }
};
